import {React, useEffect, useState} from 'react'

function Insert() {

  const [data, setData] = useState(null)

  useEffect((e)=>{
    fetchData();

    e.prevenDefault()
  })

  const fetchData = async()=>{
    try {
      const response = await fetch("http://localhost:5000/");
      if(!response.ok){
        throw new Error("No network response")
      }

      const json = await response.json()
      setData(json)
    } catch (error) {
        console.error("Error ")
    }
  }

  return (
    <div className='input-items'>
        <form action="/" method="post">
            <label htmlFor='item-name'>Item Name</label>
            <input type="text" id="item-name" name='item-name' placeholder='Enter Item name'/>
            <br />

            <label htmlFor='item-price'>Item Price</label>
            <input type="text" id="item-price" name='item-price' placeholder='Enter Item Price'/>
            <br />

            <label htmlFor='item-image'>Upload Image</label>
            <input type="file" id="item-image" name='item-image'/>
            <br />

            <button type="submit" >Make</button>
        </form>
        <h2>Message</h2>
        <p>{data}</p>
    </div>
  )
}

export default Insert
